import * as React from 'react'
import TodoTable from "./todoTable"

export default class TodoComponent extends React.Component {

    constructor(props) {
        super(props);

        this.state = {
            todos: {},
            request: Request.NONE
        }
    }

    componentDidMount() {
        alert(this.state)
    }

    render() {
        return (<TodoTable
            todos={this.state.todos}
            request={this.state.request}
        />)
    }
}
